import React from 'react';

const App=()=>{
    return(
        <div className="container">
            <div className="todoList">
                <h1>To-Do List</h1>
                <input type="text" placeholder="Enter new items" />
                <button><i class="fas fa-plus"></i></button>
            </div>
        </div>
    )
}


export default App;

